import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import galleryone from'../../../images/4_8.jpg'
import gallerytwo from'../../../images/5_8.jpg'


const Welcome = () => {
    return (
        <div>
            <Container>

            </Container>
            <Container>
                <Row>
                <Col sm><img src={galleryone} alt="" /></Col>
                <Col sm>sm=true</Col>
                <Col sm>sm=true</Col>
                <Col sm><img src={gallerytwo} alt="" /></Col>
                </Row>
            </Container>
        </div>
    );
};

export default Welcome;
